import React from "react";
import styled from "styled-components";

export default function Login(props) {
  return (
    <Container>
      <Content>
        <CTA>
          <CTAlogoOne src="images/cta-logo-one.svg" />
          <Signup>GET IT ALL THERE</Signup>
        </CTA>

        <BgImage />
      </Content>
    </Container>
  );
}

const BgImage = styled.div`
  height: 100%;
  background-image: url("images/login-background.jpg");
  z-index: -1;
  background-position: top;
  background-size: cover;
  background-repeat: no-repeat;
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
`;

const Container = styled.section`
  overflow: hidden;
  display: flex;
  flex-direction: column;
  text-align: center;
  height: 100vh;
`;

const Content = styled.div`
  margin-bottom: 10vw;
  width: 100%;
  position: relative;
  min-height: 100vh;
  box-sizing: border-box;
  display: flex;
  justify-content : center;
  align-items : center; 
  flex-direction;
  padding : 80px 40px;
  height : 100%;
`;

const CTA = styled.div`
  margin-bottom: 2vw;
  max-width: 650px;
  flex-wrap: wrap;
  display: flex;
  flex-direction: column;
  margin-top: 0;
  align-items: center;
  text-align: center;
  margin-right: auto;
  margin-left: auto;
`;

const CTAlogoOne = styled.img`
  margin-bottom: 12px;
  max-width: ;
  min-height: ;
  width: 100%;
  display: block;
`;

const Signup = styled.a`
  font-weight: bold;
  color: #f9f9f9;
`;
